import React, { Component } from "react";
import { Box } from "grommet";

const ErrorPage = props => (
  <Box
    background={"dark-1"}
    a11yTitle={"stuff"}
    align={"center"}
    allignContent={"center"}
    alignSelf={"strech"}
    basis={auto}
  >
    We are unable to find this page.
  </Box>
);

export default ErrorPage;
